/*Table structure for table `phases` */

DROP TABLE IF EXISTS `phases`;

CREATE TABLE `phases` (
  `phase_ID` int(11) NOT NULL AUTO_INCREMENT,
  `project_FK` int(11) DEFAULT NULL,
  `phase_template_FK` int(11) DEFAULT NULL,
  `phase_code` varchar(8) DEFAULT NULL,
  `phase_name` varchar(100) DEFAULT NULL,
  `phase_status` smallint(6) DEFAULT NULL,
  `phase_start` datetime DEFAULT NULL,
  `phase_end_planified` datetime DEFAULT NULL,
  `phase_end` datetime DEFAULT NULL,
  `phase_duration` int(11) DEFAULT NULL,
  `phase_delay` int(11) DEFAULT NULL,
  PRIMARY KEY (`phase_ID`),
  KEY `FKC506265853408F88` (`project_FK`),
  KEY `FKC5062658A9F10904` (`phase_template_FK`)
) ENGINE=MyISAM AUTO_INCREMENT=321 DEFAULT CHARSET=latin1;

