CREATE TABLE `phases_templates` (
  `phase_template_ID` int(11) NOT NULL AUTO_INCREMENT,
  `workflow_FK` int(11) DEFAULT NULL,
  `phase_name` varchar(100) DEFAULT NULL,
  `phase_duration_days` smallint(6) DEFAULT NULL,
  PRIMARY KEY (`phase_template_ID`),
  KEY `FKF40BD612299FC6D6` (`workflow_FK`)
