/*Table structure for table `projects` */

DROP TABLE IF EXISTS `projects`;

CREATE TABLE `projects` (
  `Project_ID` int(11) NOT NULL AUTO_INCREMENT,
  `Project_Name` varchar(255) CHARACTER SET latin1 DEFAULT NULL,
  `workflow_FK` int(11) DEFAULT NULL,
  `Category_FK` int(11) DEFAULT NULL,
  `project_status` smallint(6) DEFAULT NULL,
  `project_quantity` smallint(6) DEFAULT NULL,
  `project_comment` blob,
  `project_date_start` datetime DEFAULT NULL,
  `project_date_end` datetime DEFAULT NULL,
  `presets_templates_FK` int(11) DEFAULT NULL,
  PRIMARY KEY (`Project_ID`),
  KEY `FKC479187A6BBB7865` (`Category_FK`),
  KEY `FKC479187A299FC6D6` (`workflow_FK`),
  KEY `FKC479187A6BB9320D` (`presets_templates_FK`),
  KEY `FKC479187A1124A3ED` (`project_status`),
  KEY `FKC479187A4483111E` (`presets_templates_FK`)
) ENGINE=MyISAM AUTO_INCREMENT=78 DEFAULT CHARSET=utf8;

/*Data for the table `projects` */

/*Table structure for table `prop_presets_templates` */

DROP TABLE IF EXISTS `prop_presets_templates`;

CREATE TABLE `prop_presets_templates` (
  `prop_presets_templates_ID` int(11) NOT NULL AUTO_INCREMENT,
  `properties_presets_FK` int(11) DEFAULT NULL,
  `presets_templates_FK` int(11) DEFAULT NULL,
  `field_label` varchar(80) CHARACTER SET latin1 DEFAULT NULL,
  `field_options_value` varchar(250) DEFAULT NULL,
  `company_FK` int(11) DEFAULT NULL,
  PRIMARY KEY (`prop_presets_templates_ID`),
  KEY `FK103D90524483111E` (`presets_templates_FK`),
  CONSTRAINT `FK103D90524483111E` FOREIGN KEY (`presets_templates_FK`) REFERENCES `presets_templates` (`presets_template_ID`)
